import 'package:cloud_firestore/cloud_firestore.dart';

class Product {
  final String id;
  final String name;
  final String genre;
  final String description;
  final int stock;
  final int price;
  final String imageUrl;

  const Product({
    required this.id,
    required this.name,
    required this.genre,
    required this.description,
    required this.stock,
    required this.price,
    required this.imageUrl,
  });

  static Product fromSnapshot(DocumentSnapshot snap) {
    Product product = Product(
      id: snap['id'],
      name: snap['name'],
      genre: snap['genre'],
      description: snap['description'],
      stock: snap['stock'],
      price: snap['price'],
      imageUrl: snap['url'],
    );
    return product;
  }

